  `user_type` tinyint(2) NOT NULL DEFAULT '1' COMMENT '用户类型:1:供货商,2:分销商',
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户id',
  `user_name` varchar(50) DEFAULT NULL COMMENT '付款账号',
  `source_id` int(10) DEFAULT NULL COMMENT '订单表id或售后表id',
  `source_sn` varchar(100) DEFAULT NULL COMMENT '来源单号(order_sn,售后单号等)',
  `type` tinyint(2) NOT NULL DEFAULT '1' COMMENT '1:订单收款,2:充值,3:补款,4:虚拟订单收款',
  `status` int(11) NOT NULL DEFAULT '0' COMMENT '状态(0,未收款,1已收款)',
  `confirm_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '收款金额',
  `trade_no` varchar(40) DEFAULT '0' COMMENT '第三方流水号',
  `pay_account` varchar(50) DEFAULT NULL COMMENT '付款账户',
  `receiver_account` varchar(100) DEFAULT '' COMMENT '收款账户',
  `pay_type` tinyint(2) DEFAULT '1' COMMENT '支付方式:1:支付宝,2:银行卡,3:微信',
  `add_time` int(11) NOT NULL DEFAULT '0' COMMENT '添加时间',
  `pay_time` int(11) DEFAULT '0' COMMENT '打款时间',
  `confirm_time` int(11) DEFAULT '0' COMMENT '完成时间',
  `confirm_user_id` int(10) DEFAULT NULL COMMENT '操作完成人id',
  PRIMARY KEY (`id`),
  KEY `user_type_id` (`user_type`,`user_id`),
  KEY `type` (`type`),
  KEY `pay_type` (`pay_type`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

