-- ----------------------------
-- Table structure for cus_order_list
-- ----------------------------
DROP TABLE IF EXISTS `cus_order_list`;
CREATE TABLE `cus_order_list` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增主键',
  `order_id` int(11) unsigned NOT NULL COMMENT '订单ID',
  `order_sn` bigint(20) unsigned NOT NULL COMMENT '订单编号',
  `other_order_sn` int(11) DEFAULT NULL COMMENT '其他平台单号id',
  `other_shop` varchar(50) DEFAULT NULL COMMENT '订单第三方平台名称，如支付宝，微信',
  `buyer_id` int(32) unsigned NOT NULL COMMENT '分销商ID',
  `supplier_id` int(10) unsigned NOT NULL COMMENT '供应商id',
  `shop_id` int(11) unsigned NOT NULL COMMENT '商家id',
  `cus_type` tinyint(1) NOT NULL COMMENT '退货分类：1＝退款退货，2=退款',
  `receiver_name` varchar(255) NOT NULL COMMENT '收货姓名',
  `receiver_mobile` varchar(50) NOT NULL COMMENT '收货人手机，座机等',
  `receiver_address` varchar(255) NOT NULL COMMENT '收货人详细地址',
  `distributors_qq` bigint(20) unsigned NOT NULL COMMENT '分销商ＱＱ',
  `refund_amount` decimal(10,2) NOT NULL COMMENT '退款金额',
  `refund_status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '退款状态:1=平台待确认，2平台拒绝，3待供应商确认，4待仲裁（平台接入审核），5待平台支付，6 已完成',
  `return_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '退款状态:1=平台待确认，2平台拒绝，3等待买家发货，4等待供货商收货，5待平台打款，6 等待供货商补款，7待仲裁（平台接入），8已完成',
  `addtime` int(11) unsigned NOT NULL COMMENT '生成时间',
  `conf_time` int(11) unsigned DEFAULT NULL COMMENT '供应商确认时间',
  `receipt_time` int(11) unsigned DEFAULT NULL COMMENT '收货时间',
  `verify_time` int(11) unsigned DEFAULT NULL COMMENT '平台审核时间',
  `close_time` int(11) DEFAULT NULL COMMENT '完成或拒绝时间',
  `return_time` int(11) DEFAULT NULL COMMENT '买家退货时间',
  `arbitration_time` int(10) unsigned DEFAULT NULL COMMENT '平台仲裁时间',
  `refund_money_time` int(10) unsigned DEFAULT NULL COMMENT '平台打款时间',
  `shipping_no` varchar(20) DEFAULT NULL COMMENT '物流公司编号 目前无用',
  `shipping_fee` decimal(8,2) DEFAULT '0.00',
  `shipping_code` varchar(50) DEFAULT NULL COMMENT '运单号',
  `company_name` varchar(50) NOT NULL COMMENT '物流公司名称',
  `refund_reason` tinyint(1) NOT NULL COMMENT '售后理由：1=7天无理由，分销商承担运费；2=质量问题，供应商承担运费；3＝其他原因;',
  `remark` varchar(255) NOT NULL COMMENT '备注',
  `buyer_name` varchar(50) DEFAULT NULL COMMENT '分销商名字',
  `been_arbitrated` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否被仲裁过',
  `have_replenished` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否打款，只针对供应商需要打款时候，填写了打款信息后更新。0未打款，1已打款',
  `supplier_refuse_reason` mediumtext COMMENT '供应商售后拒绝的原因',
  `admin_arbitration_reason` varchar(255) DEFAULT NULL COMMENT '管理员仲裁的理由',
  `supplier_refuse_img` mediumtext COMMENT '供应商拒绝图片，用 | 分割',
  `supplier_show_refund` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '用于显示供应商退款',
  PRIMARY KEY (`id`),
  UNIQUE KEY `order_id` (`order_id`) USING BTREE,
  KEY `order_sn` (`order_sn`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='售后单表';

-- ----------------------------
-- Records of cus_order_list
-- ----------------------------

