  `is_up_taobao` tinyint(1) DEFAULT '2' COMMENT '1已上传到淘宝，2未上传',
  PRIMARY KEY (`id`),
  UNIQUE KEY `user_id,goods_id` (`user_id`,`goods_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

