  `distribute_user_id` int(10) unsigned NOT NULL COMMENT '分销商id',
  `distribute_result` tinyint(4) NOT NULL COMMENT '分销商态度(1,同意 2，拒绝)',
  `distribute_remark` varchar(255) DEFAULT NULL COMMENT '分销商备注说明',
  `distribute_confirm_time` int(10) unsigned NOT NULL COMMENT '分销商确认时间',
  `distribute_file` text NOT NULL COMMENT '分销商附件证据 json序列化索引数组，只存附件名，访问url前缀通过配置文件获取',
