-- ----------------------------
-- Table structure for fx_statement
-- ----------------------------
DROP TABLE IF EXISTS `fx_statement`;
CREATE TABLE `fx_statement` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键，自动增长列**资金流水表**',
  `user_type` tinyint(2) NOT NULL DEFAULT '1' COMMENT '1:供货商,2:分销商',
  `user_id` int(11) DEFAULT NULL COMMENT '用户id',
  `user_name` varchar(50) DEFAULT NULL COMMENT '用户名称',
  `trade_type` tinyint(2) NOT NULL DEFAULT '0' COMMENT '1，分销商提现（供货商没有提现的说法）[打款]，2，分销商售后补款[打款] 3，分销商售后退款[打款] 4，供货商完结订单[打款] 5，分销商下单[收款] 6，分销商充值[收款] 7，供货商补款[收款]',
  `in_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '入账金额',
  `out_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '出账金额',
  `now_balance` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '实时余额',
  `trade_account` varchar(100) DEFAULT NULL COMMENT '收付款账号',
  `trade_account_type` tinyint(2) DEFAULT NULL COMMENT '收付款账户类型',
  `trade_no` bigint(16) DEFAULT NULL COMMENT '第三方流水号或订单号',
  `add_time` bigint(20) NOT NULL DEFAULT '0' COMMENT '交易时间',
  `remark` varchar(255) DEFAULT '' COMMENT '备注',
  PRIMARY KEY (`id`),
  KEY `inx_deal_no` (`trade_no`) USING BTREE,
  KEY `type_user_id` (`user_type`,`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='财务收支明细表';

-- ----------------------------
-- Records of fx_statement
-- ----------------------------

