-- ----------------------------
-- Table structure for fx_supplier_user
-- ----------------------------
DROP TABLE IF EXISTS `fx_supplier_user`;
CREATE TABLE `fx_supplier_user` (
  `id` int(4) NOT NULL AUTO_INCREMENT COMMENT '主键，自动增长列**供货商表**',
  `user_account` varchar(50) DEFAULT NULL COMMENT '平台登录名',
  `userpwd` char(60) DEFAULT NULL COMMENT '登录密码',
  `leavel` int(4) NOT NULL DEFAULT '0' COMMENT '供货商等级 0基础版 1初级 2中级 3高级',
  `addtime` datetime DEFAULT NULL COMMENT '添加时间',
  `lastupdatetime` datetime DEFAULT NULL COMMENT '最后修改时间',
  `usernick` varchar(50) DEFAULT NULL COMMENT '昵称',
  `sex` int(4) DEFAULT NULL COMMENT '性别',
  `age` int(50) DEFAULT NULL COMMENT '年龄',
  `city` varchar(50) DEFAULT NULL COMMENT '城市',
  `mobile` varchar(20) DEFAULT NULL COMMENT '联系手机',
  `phone` varchar(20) DEFAULT NULL COMMENT '联系电话',
  `province` varchar(50) DEFAULT NULL COMMENT '省份',
  `register_type` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT '注册类型(0 个人 1 企业)',
  `address` varchar(200) DEFAULT NULL COMMENT '地址',
  `idcard` varchar(50) DEFAULT NULL COMMENT '身份证号或企业资质号',
  `account_status` int(11) DEFAULT '2' COMMENT '帐号状态(1，禁用 2，正常)',
  `balance` decimal(11,0) DEFAULT NULL COMMENT '余额',
  `platform` tinyint(2) NOT NULL DEFAULT '1' COMMENT '1:星密码,2:创想范',
  `pay_pwd` varchar(50) DEFAULT NULL COMMENT '支付密码',
  `email` varchar(50) DEFAULT NULL COMMENT '邮箱',
  `approve_status` int(11) DEFAULT '1' COMMENT '审核状态(1,待审核 2 审核拒绝 3 审核通过)',
  `qq` varchar(50) DEFAULT NULL COMMENT 'QQ号码',
  `wangwang` varchar(50) DEFAULT NULL COMMENT '旺旺号码',
  `approve_user` varchar(50) DEFAULT NULL COMMENT '审核人',
  `approve_time` datetime DEFAULT NULL COMMENT '审核时间',
  `approve_remark` varchar(200) DEFAULT NULL COMMENT '审核备注（拒绝原因）',
  `realname` varchar(50) DEFAULT NULL COMMENT '真实姓名',
  `applicant_idcard_img` varchar(400) DEFAULT NULL COMMENT '申请人身份证正反面图',
  `legal_idcard_img` varchar(400) DEFAULT NULL COMMENT '法人身份证正反面图',
  `business_license` varchar(400) DEFAULT NULL COMMENT '营业执照',
  `receiver_account_type` tinyint(4) DEFAULT NULL COMMENT '(收款帐号类型 1，支付宝，2 银行卡 3 微信)',
  `open_bank_address` varchar(100) DEFAULT NULL COMMENT '开户行(例:河北大学保定支行)',
  `receiver_account` varchar(255) DEFAULT NULL COMMENT '收款帐号',
  `receiver_account_name` varchar(50) DEFAULT NULL COMMENT '收款账户名',
  `company_name` varchar(50) DEFAULT NULL COMMENT '企业名称',
  `applicant_idcard_img_hand` varchar(255) DEFAULT NULL COMMENT '手持身份证',
  `manager_category` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '经营类目',
  PRIMARY KEY (`id`),
  UNIQUE KEY `username` (`user_account`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of fx_supplier_user
-- ----------------------------

-- ----------------------------
-- Table structure for fx_tb_user
-- ----------------------------
DROP TABLE IF EXISTS `fx_tb_user`;
CREATE TABLE `fx_tb_user` (
  `tb_user_id` bigint(20) DEFAULT NULL COMMENT '淘宝用户ID',
  `userid` int(11) NOT NULL DEFAULT '0' COMMENT '对应平台用户ID',
  `nick` varchar(60) NOT NULL COMMENT '淘宝账号昵称',
  `avatar` varchar(255) DEFAULT NULL COMMENT '淘宝用户头像地址',
  `status` tinyint(1) DEFAULT '0' COMMENT '账号状态 0:正常 1:禁用 3:已删除',
  `type` varchar(2) DEFAULT 'C' COMMENT '用户类型。可选值:B(B商家),C(C商家)',
  `promoted` tinyint(1) DEFAULT '0' COMMENT '是否实名 0:否 1:是',
  `has_shop` tinyint(1) DEFAULT '0' COMMENT '是否开店 0:否 1:是',
  `shop_id` bigint(20) DEFAULT NULL COMMENT '店铺ID',
  `has_more_pic` tinyint(1) DEFAULT '1' COMMENT '是否购买多图服务 0:否 1:是',
  `item_img_num` int(11) DEFAULT '999999' COMMENT '可上传商品图片数量',
  `item_img_size` int(11) DEFAULT '1024' COMMENT '单张商品图片最大容量(商品主图大小)。单位:k',
  `level` int(11) DEFAULT '0',
  `score` int(11) DEFAULT '0',
  `is_golden_seller` tinyint(1) DEFAULT '0' COMMENT '是否是金牌卖家 0:否 1:是',
  `part_send` tinyint(1) DEFAULT '0' COMMENT '是否部分发货 0:否 1:是',
  `auto_rate` tinyint(1) DEFAULT '0' COMMENT '是自动评价 0:否 1:是',
  `auto_rate_content` varchar(100) DEFAULT NULL COMMENT '自动评价内容',
  `cookie` text COMMENT '淘宝账号cookie',
  `cookie_expire_time` bigint(20) DEFAULT NULL COMMENT 'cookie 过期时间',
  `access_token` varchar(255) DEFAULT NULL,
  `refresh_token` varchar(255) DEFAULT NULL,
  `expire_time` bigint(20) DEFAULT NULL COMMENT 'Access token 过期时间',
  `w2_valid` bigint(20) DEFAULT NULL COMMENT 'w2级别API访问过期时间',
  `r2_valid` bigint(20) DEFAULT NULL COMMENT 'r2级别API访问过期时间',
  `refresh_token_valid_time` bigint(20) DEFAULT NULL COMMENT 'Refresh token 过期时间',
  `addtime` datetime DEFAULT NULL COMMENT '添加时间',
  `updatetime` datetime DEFAULT NULL COMMENT '最后更新时间',
  `is_agent` tinyint(1) DEFAULT '0' COMMENT '是否托管 0:否 1:是',
  `site_category` tinyint(1) DEFAULT NULL COMMENT '店铺版本(1:基础版,2:专业版)',
  `site_instance_id` bigint(20) DEFAULT NULL,
  `page_id` bigint(20) DEFAULT NULL,
  `prototype_id` int(11) DEFAULT NULL,
  `widget_id_hd` bigint(20) DEFAULT NULL,
  `widget_id_bd` bigint(20) DEFAULT NULL,
  `widget_id_ft` bigint(20) DEFAULT NULL,
  `default` tinyint(1) DEFAULT '0' COMMENT '是否默认店铺 0:否 1:是',
  UNIQUE KEY `tb_user_id` (`userid`,`tb_user_id`),
  KEY `userid` (`userid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='淘宝账号';

-- ----------------------------
-- Records of fx_tb_user
-- ----------------------------

