-- ----------------------------
DROP TABLE IF EXISTS `fx_uptaobao_good_logs`;
CREATE TABLE `fx_uptaobao_good_logs` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT ' --主键，自动增长列 **铺货日志记录表**',
  `user_id` int(11) NOT NULL COMMENT '用户id',
  `goods_id` int(4) NOT NULL COMMENT '[铺货商品id]',
  `user_account` varchar(50) DEFAULT NULL COMMENT '[可加字段，方便读取]',
  `goods_name` varchar(100) DEFAULT NULL COMMENT '商品标题[可加字段，方便读取]',
  `price` decimal(10,2) DEFAULT NULL COMMENT '商品价格（可加字段）',
  `is_success` int(4) DEFAULT NULL COMMENT '是否成功(0,成功 1 ，失败)',
  `tb_nick` varchar(50) DEFAULT NULL COMMENT '店铺昵称',
  `addtime` bigint(20) DEFAULT NULL COMMENT '添加时间',
  `fail_msg` varchar(255) DEFAULT NULL COMMENT '铺货失败原因',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

