-- ----------------------------
-- Table structure for fx_verify
-- ----------------------------
DROP TABLE IF EXISTS `fx_verify`;
CREATE TABLE `fx_verify` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `code` varchar(20) NOT NULL COMMENT '验证码',
  `target` varchar(100) NOT NULL DEFAULT 'regist' COMMENT '发送验证码的目标位置，用来约束验证码有效范围，默认为注册',
  `mobile` bigint(20) unsigned NOT NULL COMMENT '手机号码',
  `email` varchar(100) NOT NULL COMMENT '邮箱',
  `wrong_times` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '验证码错误次数，用于失效验证码',
  `add_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '验证码生成时间',
  `update_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间，用于判断验证码上一次输错时间，或下一次可调用时间',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '验证码是否可用，1可用，0不可用',
  PRIMARY KEY (`id`),
  KEY `code` (`code`,`target`),
  KEY `email` (`email`),
  KEY `mobile` (`mobile`)
) ENGINE=InnoDB AUTO_INCREMENT=45 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of fx_verify
-- ----------------------------

