  `agent_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '代理价格',
  `img_url` varchar(255) NOT NULL DEFAULT '' COMMENT '图片地址',
  `updatetime` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`)
