-- Table structure for fx_virtual_order
-- ----------------------------
DROP TABLE IF EXISTS `fx_virtual_order`;
CREATE TABLE `fx_virtual_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `order_sn` varchar(20) NOT NULL DEFAULT '0' COMMENT '交易号',
  `order_type` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1:新增用户购买,2:用户升级',
  `price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商品价格',
  `pay_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '支付金额',
  `add_time` int(11) NOT NULL DEFAULT '0' COMMENT '添加时间',
  `payment_time` int(11) NOT NULL DEFAULT '0' COMMENT '支付时间',
  `status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '状态（1.待付款‘2.已完成；3.已关闭）',
  `distribute_user_id` int(11) NOT NULL COMMENT '分销商id',
  `virtual_goods_id` int(11) NOT NULL COMMENT '虚拟商品id',
