-- ----------------------------
-- Table structure for goods_category
-- ----------------------------
DROP TABLE IF EXISTS `goods_category`;
CREATE TABLE `goods_category` (
  `category_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '平台类目ID',
  `status` int(11) DEFAULT '0' COMMENT '是否禁用 0:新建 1:正常 2:禁用',
  `has_goods` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0:没有商品,1:有商品',
  `name` varchar(255) NOT NULL COMMENT '类目名称',
  `name_alias` varchar(255) DEFAULT NULL,
  `html_style` varchar(255) DEFAULT NULL COMMENT '页面显示样式',
  `cid` int(11) DEFAULT '0' COMMENT '对应淘宝类目ID',
  `parent_cid` int(11) DEFAULT '0' COMMENT '父级淘宝类目ID',
  `parent_id` int(11) DEFAULT '0' COMMENT '父级ID',
  `level` tinyint(1) DEFAULT '0' COMMENT '类目等级',
  `order` int(11) DEFAULT '0' COMMENT '顺序',
  `ico` varchar(255) DEFAULT NULL COMMENT '一级分类小图标',
  `title` varchar(100) DEFAULT NULL COMMENT '大类显示title（首页）',
  `is_show` int(4) DEFAULT NULL COMMENT '大类控制是否显示(0,不显示，1，显示)',
  `big_ico` varchar(200) DEFAULT NULL COMMENT '一级类目大图标',
  PRIMARY KEY (`category_id`),
