-- ----------------------------
-- Table structure for goods_list
-- ----------------------------
DROP TABLE IF EXISTS `goods_list`;
CREATE TABLE `goods_list` (
  `goods_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '商品ID',
  `goods_no` varchar(50) NOT NULL COMMENT '商品货号',
  `goods_category` int(11) NOT NULL COMMENT '商品类目',
  `goods_name` varchar(62) NOT NULL COMMENT '商品名称',
  `goods_sale` tinyint(1) NOT NULL COMMENT '商品上下架:1=上架，2=下架，(默认2)',
  `sale_time` int(11) NOT NULL DEFAULT '0' COMMENT '上架时间',
  `off_sale_time` int(11) NOT NULL DEFAULT '0' COMMENT '下架时间',
  `goods_status` tinyint(11) NOT NULL DEFAULT '1' COMMENT '商品状态:1=待审核,2=未通过,3=已通过',
  `conf_time` int(11) NOT NULL DEFAULT '0' COMMENT '审核时间',
  `buyer_goods_no` varchar(100) NOT NULL COMMENT '商家的编码',
  `supplier_id` int(11) NOT NULL COMMENT '供应商ＩＤ',
  `depot_id` int(11) NOT NULL DEFAULT '0' COMMENT '仓库ID',
  `new_upload` tinyint(1) NOT NULL DEFAULT '0' COMMENT '新上传:0是：1否',
  `is_missing` tinyint(1) NOT NULL DEFAULT '0' COMMENT '商品是否残缺：0=否，1=是',
  `img_path` varchar(100) NOT NULL DEFAULT '' COMMENT '图片地址',
  `stock_update_time` int(11) NOT NULL DEFAULT '0' COMMENT '库存修改时间',
  `is_delete` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否删除：0＝否：1＝是',
  `addtime` int(11) NOT NULL DEFAULT '0' COMMENT '添加时间',
  `goods_lack` tinyint(1) NOT NULL DEFAULT '0' COMMENT '商品是否缺失：0=否，1=是',
  `goods_lack_momo` varchar(255) NOT NULL DEFAULT '' COMMENT '商品信息缺失内容',
  `stock_num` int(10) NOT NULL DEFAULT '0' COMMENT '总库存',
  `price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '原价',
  `top_category` int(10) NOT NULL DEFAULT '0' COMMENT '顶级父目录',
  `platform` tinyint(2) NOT NULL DEFAULT '1' COMMENT '平台:1:星密码,2:创想范',
  `item_weight` float(10,2) NOT NULL DEFAULT '0.00' COMMENT '物流重量',
  `sale_count` int(10) NOT NULL DEFAULT '0' COMMENT '售出数量',
  `fx_count` int(10) NOT NULL DEFAULT '0' COMMENT '分销总数',
  `collect_count` int(10) NOT NULL DEFAULT '0' COMMENT '收藏数量',
  `picture_path` varchar(100) DEFAULT NULL COMMENT '商品主图2',
  `img_paths` varchar(1000) DEFAULT NULL COMMENT '轮播图片地址',
  PRIMARY KEY (`goods_id`),
  UNIQUE KEY `goods_no_category` (`goods_category`,`buyer_goods_no`),
  KEY `goods_category` (`goods_category`),
  KEY `goods_status` (`goods_status`),
  KEY `supplier_id` (`supplier_id`),
  KEY `is_missing` (`is_missing`),
  KEY `is_delete` (`is_delete`),
  KEY `goods_name` (`goods_name`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8 COMMENT='商品表';

-- ----------------------------
-- Records of goods_list
-- ----------------------------

