  `sku_val` varchar(1000) NOT NULL COMMENT 'sku值,数组json后序列化',
  `sku_val_str` varchar(1000) DEFAULT NULL COMMENT '商品属性值字符串(数组json后序列化，且顺序必须和sku_val一致)',
  PRIMARY KEY (`id`),
  KEY `goods_id` (`goods_id`)
