  `sku_str` varchar(255) CHARACTER SET utf8 NOT NULL COMMENT '商品SKU值',
  `sku_str_zh` varchar(255) CHARACTER SET utf8 NOT NULL COMMENT '商品SKU组合字符串（中文）',
  `stock_num` int(11) NOT NULL COMMENT '库存',
  `sale_count` int(10) NOT NULL DEFAULT '0' COMMENT '售出数量',
  `sku_attr` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT 'sku属性(用于搜索)',
  `stock_lock_num` int(11) DEFAULT '0' COMMENT '预警库存',
  `original_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '原价',
  PRIMARY KEY (`id`),
  UNIQUE KEY `goods_sku_attr` (`goods_id`,`sku_attr`),
  KEY `goods_id` (`goods_id`)
) ENGINE=InnoDB AUTO_INCREMENT=212 DEFAULT CHARSET=cp1250;

