DROP TABLE IF EXISTS `hub_order`;
CREATE TABLE `hub_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自主增键',
  `order_id` int(11) NOT NULL COMMENT '订单ID',
  `order_sn` bigint(20) NOT NULL COMMENT '订单编号',
  `buyer_id` varchar(50) NOT NULL COMMENT '分销商ID',
  `buyer_name` varchar(50) NOT NULL COMMENT '分销商用户名',
  `ship_stats` tinyint(1) NOT NULL COMMENT '发货状态：0＝待配货，1：待分配，2=待发货，3=已发货',
  `hub_type` tinyint(1) NOT NULL DEFAULT '1' COMMENT '面单分类：1=普通面单，2=电子面单',
  `shipping_code` varchar(50) NOT NULL COMMENT '运单号',
  `shipping_name` varchar(50) NOT NULL COMMENT '物流公司',
  `shipping_no` varchar(50) NOT NULL COMMENT '物流公司编号',
  `memo` text COMMENT '订单备注',
  `order_time` int(11) NOT NULL COMMENT '订单生成时间',
  `con_time` int(11) NOT NULL COMMENT '订单确认时间',
  `receiver_name` varchar(20) NOT NULL COMMENT '收件人姓名',
  `receiver_tel` varchar(20) NOT NULL COMMENT '收件人电话',
  `buyer_goods_no` varchar(50) NOT NULL COMMENT '商家编的码',
  `shop_id` int(11) NOT NULL COMMENT '平台ID',
  `depot_id` int(11) NOT NULL COMMENT '仓库地址',
  `addtime` int(11) NOT NULL COMMENT '生成时间',
  `shipping_fee` decimal(10,2) DEFAULT NULL COMMENT '运费',
  `is_print` tinyint(1) NOT NULL COMMENT '配合单是否打印：1=打印,2=未打印',
  `print_no` varchar(50) NOT NULL COMMENT '打印编号',
  `shipping_is_print` tinyint(1) NOT NULL COMMENT '面单是否打印：1=打印,0=未打印',
  `shipping_info` text NOT NULL COMMENT '面单接口返回数据',
  PRIMARY KEY (`id`),
  KEY `order_id` (`order_id`),
  KEY `order_sn` (`order_sn`),
  KEY `buyer_id` (`buyer_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='发货订单表';

