CREATE TABLE `order_goods_sku` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增主键',
  `order_id` int(11) NOT NULL COMMENT '主订单ID',
  `goods_id` int(11) NOT NULL COMMENT '订单商品ID',
  `sku_comb_id` int(11) NOT NULL COMMENT '订单商品SKU组合ID',
  PRIMARY KEY (`id`),
  UNIQUE KEY `order_goods_comb_id` (`order_id`,`goods_id`,`sku_comb_id`),
  KEY `order_id` (`order_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单商品SKU表';

