-- ----------------------------
-- Table structure for order_list
-- ----------------------------
DROP TABLE IF EXISTS `order_list`;
CREATE TABLE `order_list` (
  `order_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '订单索引自增主键',
  `order_sn` bigint(20) NOT NULL COMMENT '订单编号',
  `other_order_sn` varchar(100) NOT NULL COMMENT '第三方订单编号',
  `other_shop` varchar(100) NOT NULL COMMENT '第三方平台名称',
  `buyer_id` int(11) NOT NULL DEFAULT '0' COMMENT '分销商ID',
  `buyer_name` varchar(100) NOT NULL COMMENT '分销商名称',
  `shop_id` int(11) NOT NULL COMMENT '订单来源id（1：web版，2：客户端）',
  `add_time` int(11) NOT NULL COMMENT '订单生成时间',
  `payment_time` int(10) NOT NULL COMMENT '支付(付款)时间',
  `finnshed_time` int(10) NOT NULL COMMENT '订单完成时间',
  `goods_amount` decimal(10,2) NOT NULL COMMENT '商品总价格',
  `order_amount` decimal(10,2) NOT NULL COMMENT '订单总价格',
  `cost_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '成本价（成交总价，供货商）',
  `pay_amount` decimal(10,2) NOT NULL COMMENT '支付金额',
  `order_state` tinyint(4) NOT NULL COMMENT '订单状态：0＝待付款，1=已付款待确认，2=已确认待发货，3＝已确认已发货，4＝已完成，5=已关闭，6=异常',
  `con_time` int(11) NOT NULL COMMENT '确认时间',
  `send_hub_time` int(11) NOT NULL COMMENT '发货时间',
  `close_time` int(11) NOT NULL COMMENT '关闭或完成时间',
  `order_marked` tinyint(1) NOT NULL COMMENT '订单标记:0=未打印，1=已打印，2=分配失败',
  `shipping_code` varchar(50) NOT NULL COMMENT '物流单号',
  `shipping_id` int(11) NOT NULL COMMENT '物流公司ID',
  `shipping_name` varchar(50) NOT NULL COMMENT '物流公司名称',
  `shipping_fee` decimal(10,2) NOT NULL COMMENT '运费',
  `qq` varchar(16) NOT NULL COMMENT '分销商QQ',
  `message_starts` tinyint(11) NOT NULL COMMENT '留言状态：0＝没有留言，1=有留言',
  `memo` text NOT NULL COMMENT '备注',
  `is_send_hub` tinyint(1) NOT NULL COMMENT '是否发货',
  `is_cus` tinyint(1) NOT NULL COMMENT '是否有售后：0=没有售后，1=有售后',
  `hub_type` tinyint(1) NOT NULL COMMENT '面单分类：1=普通面单，2=电子面单',
  `receiver_name` varchar(20) NOT NULL COMMENT '最新联系人姓名',
  `receiver_tel` varchar(20) NOT NULL COMMENT '最新联系人电话',
  `is_edit_address` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否修改过收货地址：0=未编辑，1=有编辑',
  `shipping_info` text NOT NULL COMMENT '面单接口返回数据',
  `supplier_id` int(11) NOT NULL DEFAULT '0' COMMENT '供应商id（商品的供应商）',
  `is_supplier_close` tinyint(2) NOT NULL DEFAULT '0' COMMENT '是否是总台关闭订单（0.否；1.是）',
  `is_pay` tinyint(1) DEFAULT '0' COMMENT '是否付款（0：未付款，1：已付款）',
  PRIMARY KEY (`order_id`),
  UNIQUE KEY `order_sn` (`order_sn`),
  KEY `inx_buyer_id` (`buyer_id`),
  KEY `buyer_id` (`buyer_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单列表';

-- ----------------------------
-- Records of order_list
-- ----------------------------

-- ----------------------------
-- Table structure for order_message
-- ----------------------------
DROP TABLE IF EXISTS `order_message`;
CREATE TABLE `order_message` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增主键',
  `order_id` int(11) NOT NULL COMMENT '主订单ID',
  `user_type` int(11) NOT NULL COMMENT '角色类型：1=贷应商，2=管理员，3=分销商',
  `user_id` varchar(100) NOT NULL COMMENT '用户ID',
  `message` varchar(255) NOT NULL COMMENT '消息：限制120个汉字',
  `addtime` int(11) NOT NULL COMMENT '生成时间',
  `to_user_type` int(11) NOT NULL COMMENT '发向角色类型：1=贷应商，2=管理员，3=分销商',
  PRIMARY KEY (`id`),
  KEY `order_id` (`order_id`),
  KEY `order_user_id` (`order_id`,`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单留言表';

-- ----------------------------
-- Records of order_message
-- ----------------------------

