  `receiver_tel` varchar(20) NOT NULL COMMENT '电话',
  `supplier_user_id` int(11) DEFAULT NULL COMMENT '供货商ID',
  PRIMARY KEY (`id`),
  KEY `supplier_user_id` (`supplier_user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='仓库表';

