-- ----------------------------
-- Table structure for taobao_authorize
-- ----------------------------
DROP TABLE IF EXISTS `taobao_authorize`;
CREATE TABLE `taobao_authorize` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` varchar(50) NOT NULL COMMENT '系统登录用户',
  `taobao_user_nick` varchar(50) NOT NULL COMMENT '淘宝帐户',
  `access_token` varchar(255) NOT NULL COMMENT 'Access token',
  `expires_in` int(11) NOT NULL COMMENT 'Access token过期时间',
  `return_data` text NOT NULL COMMENT '序列化返回所有数据',
  `re_expires_in` int(11) NOT NULL COMMENT 'Refresh token过期时间',
  `expire_time` bigint(13) NOT NULL COMMENT 'Access token过期时间',
  `r1_expires_in` bigint(13) NOT NULL COMMENT 'r1级别API或字段的访问过期时间；',
  `w2_valid` varchar(13) NOT NULL COMMENT 'w2级别API或字段的访问过期时间；',
  `w2_expires_in` bigint(13) NOT NULL COMMENT '淘宝帐号对应id',
  `taobao_user_id` bigint(20) NOT NULL COMMENT '淘宝帐号对应id',
  `w1_expires_in` int(11) NOT NULL,
  `r1_valid` bigint(13) NOT NULL,
  `r2_valid` bigint(13) NOT NULL,
  `w1_valid` bigint(13) NOT NULL,
  `r2_expires_in` bigint(13) NOT NULL,
  `token_type` varchar(20) NOT NULL,
  `refresh_token` varchar(100) NOT NULL,
  `refresh_token_valid_time` bigint(13) NOT NULL,
  `raw` varchar(100) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

